import {NavLink, Outlet} from 'react-router-dom';

import Main from '../layouts/main'
import Subnavigation from '../layouts/subnavigation'
import '../styles/theme.css'

const Dashboards = ({className}) => (
  <Main className={className}>
    <Subnavigation title='Dashboards'>
      <NavLink to='/dashboards/all'>All</NavLink>
      <NavLink to='/dashboards/saved1'>Dash1</NavLink>
      <NavLink to='/dashboards/saved2'>Dash2</NavLink>
    </Subnavigation>
    <Outlet/>
  </Main>
);

export default Dashboards;
